using System.Linq.Expressions;
using Microsoft.EntityFrameworkCore.Query;
using Microsoft.VisualStudio.TestPlatform.CommunicationUtilities.Resources;
using Moq;
using Streetcode.DAL.Entities.Media.Images;
using Streetcode.DAL.Entities.Sources;
using Streetcode.DAL.Repositories.Interfaces.Base;

namespace Streetcode.XUnitTest.Mocks
{
    internal partial class RepositoryMocker
    {
        public static Mock<IRepositoryWrapper> GetImageMainRepositoryMock()
        {
            var imagesMain = new List<ImageMain>()
            {
                new ImageMain()
                {
                    Id = 1,
                    Base64 = "",
                    MimeType = "image/gif",
                    BlobName = "testBlobName1"
                },
                new ImageMain()
                {
                    Id = 2,
                    Base64 = "",
                    MimeType = "image/jpeg",
                    BlobName = "testBlobName2",
                }
            };

            var images = new List<Image>()
            {
            new Image
            {
                Id = 1,
                Base64 = "First base 64",
                BlobName = "First image blob name",
                MimeType = "First image mime type",
            },
            new Image
            {
                Id = 2,
                Base64 = "Second base 64",
                BlobName = "Second image blob name",
                MimeType = "Second image mime type",
            },
            new Image
            {
                Id = 3,
                Base64 = "Third base 64",
                BlobName = "Third image blob name",
                MimeType = "Third image mime type",
            },
            new Image
            {
                Id = 4,
                Base64 = "Fourth base 64",
                BlobName = "Fourth image blob name",
                MimeType = "Fourth image mime type",
            },
            };

            var mockRepo = new Mock<IRepositoryWrapper>();

            mockRepo.Setup(x => x.ImageMainRepository.GetAllAsync(It.IsAny<Expression<Func<ImageMain, bool>>>(),
                It.IsAny<Func<IQueryable<ImageMain>,
                IIncludableQueryable<ImageMain, object>>>()))
                .ReturnsAsync(imagesMain);

            mockRepo.Setup(repo => repo.ImageMainRepository.GetFirstOrDefaultAsync(
            It.IsAny<Expression<Func<ImageMain, bool>>>(),
            It.IsAny<Func<IQueryable<ImageMain>,
            IIncludableQueryable<ImageMain, object>>>()))
            .ReturnsAsync(
            (
                Expression<Func<ImageMain, bool>> predicate,
                Func<IQueryable<ImageMain>,
                IIncludableQueryable<ImageMain, object>> include) =>
            {
                return imagesMain.FirstOrDefault(predicate.Compile());
            });

            mockRepo.Setup(repo => repo.ImageRepository.GetFirstOrDefaultAsync(
            It.IsAny<Expression<Func<Image, bool>>>(),
            It.IsAny<Func<IQueryable<Image>,
            IIncludableQueryable<Image, object>>>()))
            .ReturnsAsync(
            (
                Expression<Func<Image, bool>> predicate,
                Func<IQueryable<Image>,
                IIncludableQueryable<Image, object>> include) =>
            {
                return images.FirstOrDefault(predicate.Compile());
            });

            mockRepo.Setup(x => x.ImageMainRepository.CreateAsync(It.IsAny<ImageMain>()))
            .ReturnsAsync((ImageMain im) =>
            {
                imagesMain.Add(im);
                return im;
            });

            mockRepo.Setup(x => x.ImageMainRepository.Delete(It.IsAny<ImageMain>()))
            .Callback((ImageMain im) =>
            {
                im = imagesMain.FirstOrDefault(x => x.Id == im.Id);
                if (im is not null)
                {
                    imagesMain.Remove(im);
                }
            });

            mockRepo.Setup(x => x.SaveChangesAsync()).ReturnsAsync(1);

            return mockRepo;
        }
    }
}
